import React from "react";
import {NavLink, Link, Outlet} from 'react-router-dom';

export default function NavBar()
{
    // display: flex;
    // max-height: 90px;
    // justify-content: space-between;
    // background-color: slategrey;
    // color: whitesmoke;
    let navStyle = {
        display: "flex",
        height: "100px",
        justifyContent: "space-between",
        backgroundColor: "slategrey",
        color: "whitesmoke",
        alignItems: "center",
        borderRadius: "3px",
    }
    let divStyle = {
        display: "flex",
        // flexDirection: "row-reverse",
        // float: "right",
        justifyContent: "space-between",
        margin: "15px",
        width: "30%",
        /* color: whitesmoke; */
        display: "flex",
        fontSize: "20px",
}
    
    // let h3Style = {
    //     margin: "10px",
    // }
    let aStyle = {
        color: "whitesmoke",
        textDecoration: "none",
    }
    return (
        <div>
            <nav style = {navStyle}>
                <Link to = "/"><img className = "nav--logo" src="" alt="Logo"/></Link>
                <div style={divStyle}>
                    <NavLink to="/">Home</NavLink>
                    <NavLink to="/blogs">Blogs</NavLink>
                    <NavLink to="/contact">Contacts</NavLink>
                    <NavLink to="/about">About</NavLink>
                </div>
            </nav>
            <Outlet/>
        </div>
    )
}
